// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Componentes de "placeholder" que crearemos después
const LoginPage = () => <div className="min-h-screen flex items-center justify-center bg-gray-100"><h1 className="text-3xl text-gray-800">Página de Login</h1></div>;
const HomePage = () => <div className="min-h-screen flex items-center justify-center bg-green-100"><h1 className="text-3xl text-green-800">Página Principal</h1></div>;
const UserCrudPage = () => <div className="min-h-screen flex items-center justify-center bg-blue-100"><h1 className="text-3xl text-blue-800">Gestión de Usuarios (CRUD)</h1></div>;

function App() {
  // Aquí podrías manejar el estado de autenticación (ej. si el usuario está logueado)
  const isAuthenticated = false; // Por ahora, asumimos que no está autenticado

  return (
    <Router>
      <Routes>
        {/* Ruta para el login */}
        <Route path="/login" element={<LoginPage />} />

        {/* Rutas protegidas (requieren autenticación) */}
        <Route
          path="/"
          element={isAuthenticated ? <HomePage /> : <Navigate to="/login" />}
        />
        <Route
          path="/users"
          element={isAuthenticated ? <UserCrudPage /> : <Navigate to="/login" />}
        />

        {/* Redirección para cualquier otra ruta no definida a la página principal o login */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </Router>
  );
}

export default App;
